import React from "react";
import './style.css';
import lisa from "./lisa.jpg";
import angry from "./angry.jpg";
import nutri from "./nutri.png";
import uniqlo from "./uniqlo.png";

function Grid() {
  return (
    <div className="grid-container">
      <div className="container">
        <div className="grid-item">
          <img src={uniqlo} alt="uniqlo" />
          <div className="overlay">
            <div className="text">UI Design: UNIQLO App Redesign</div>
          </div>
        </div>
      </div>
      <div className="container">
        <div className="grid-item">
          <img src={nutri-cover} alt="nutri" />
          <div className="overlay">
            <div className="text">UI Design: Nutri Prototype</div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Grid;
